        "body_html": "Mature, estate-grown Blue Weber agave aged 5–6 years is harvested to make this bright and lively tequila. After cooking in a brick oven, the piñas are milled and fermented for 80–90 hours while temperature and nutrient levels are carefully supervised. Twice-distilled in copper pots and proofed with water from the distillery’s own wells, the resulting distillate is then double-filtered, creating a tequila that is friendly yet expressive, balancing the high floral notes Arandas is famous for, such as pink peppercorn and fresh sweet herbs, with delicate fruit and citrus zest. 40% ABV",
